hange to a number in inserted shortcode to set word limit)%2$s'=>'Mostrar descrições de eventos %1$s(mudar para um número no código de atalho inserido para definir o limite de palavras)%2$s','Show event locations %1$s(if available)%2$s'=>'Mostrar locais de eventos %1$s(se disponível)%2$s','Show event organizers %1$s(if available)%2$s'=>'Organizadores de eventos %1$s(se disponível)%2$s','%1$sNote:%2$s Additional %3$sdisplay options%4$s are available by manually editing the shortcode after insertion.'=>'%1$sNota:%2$s Opções adicionais de %3$sexibição%4$s estão disponíveis editando manualmente o código de atalho após a inserção.','Insert %1$s'=>'Inserir %1$s','Do even more with %1$s!'=>'Faça ainda mais com %1$s!','Calendar Builder'=>'Construtor de calendário','Configure all calendar settings with an easy visual interface... no need to manually type shortcodes.'=>'Defina todas as configurações do calendário com uma interface visual fácil... não há necessidade de digitar manualmente os códigos de acesso.','Additional Views and Enhanced Features'=>'Visualizações adicionais e recursos aprimorados','New ways to display your calendar including Full, Up Next, Masonry, Month with Sidebar, Widget, and more. Additional capabilities are added to the core Month, Basic, List and Week views.'=>'Novas maneiras de exibir o calendário, incluindo Full, Up Next, Masonry, Month with Sidebar, Widget e muito mais. Recursos adicionais foram adicionados às visualizações principais Month, Basic, List e Week.','Customizer'=>'Personalizar','Easily modify your calendar color palettes, fonts, and more, site-wide.'=>'Modifique facilmente as paletas de cores do calendário, as fontes e muito mais, em todo o site.','ICS Events'=>'Eventos da ICS','%1$sNew!%2$s Turns %3$s into a full calendar system. Create and manage events directly in WordPress and even integrate them seamlessly with your existing feeds.'=>'%1$sNovo!%2$s Transforma o %3$s em um sistema de calendário completo. Crie e gerencie eventos diretamente no WordPress e até mesmo integre-os perfeitamente aos seus feeds existentes.','Visit %1$s to learn more.'=>'Visite %1$s para saber mais.','Go PRO!'=>'Atualize para PRO!','Getting Started'=>'Começando','System Report'=>'Relatório do sistema','Save Changes'=>'Salvar Alterações','Thank you for installing %1$s. Before creating your first calendar shortcode, please visit your %2$sGeneral Settings%3$s page and verify that your site language, timezone and date/time format settings are correct. See our %4$sUser Guide%5$s for more information.'=>'Obrigado por instalar %1$s. Antes de criar seu primeiro atalho de calendário, visite sua página %2$sConfigurações Gerais%3$s e verifique se o idioma de seu site, fuso horário e configurações de formato de data/hora estão corretos. Consulte nosso %4$sGuia do Usuário%5$s para mais informações.','Quick Start Guide'=>'Guia de Início Rápido','An extensive %1$sUser Guide%2$s is available on our website. Below are some quick links to key resources in the documentation.'=>'Um extenso %1$sGuia do Usuário%2$s está disponível em nosso site. Abaixo estão alguns links rápidos para os principais recursos da documentação.','General:'=>'Geral:','General WordPress Settings'=>'Configurações gerais do WordPress','%1$s Settings'=>'%1$s configurações','Working with Shortcodes:'=>'Trabalhando com códigos curtos:','Shortcode Overview'=>'Visão geral do shortcode','Shortcode Builder'=>'Gerar Shortcode','Shortcode Parameters Reference'=>'Referência de parâmetros de shortcode','Advanced Topics:'=>'Tópicos avançados:','FAQs and Tips'=>'Perguntas frequentes e dicas','CSS Guide'=>'Guia CSS','Developer Resources'=>'Recursos para desenvolvedores','GDPR'=>'GDPR','Appearance'=>'Aparência','Match calendar color palette to current Block Theme colors'=>'Corresponder a paleta de cores do calendário às cores atuais do tema do bloco','beta'=>'Beta','Replaces the %1$s default neutral color palette with nearest matches from the current Site Editor Styles color palette or the %2$s file in your theme. Color selections are algorithmic, and some combinations may not pass accessibility contrast tests. This setting has no effect if you are using a "classic" theme that does not include a %3$s file.'=>'Substitui a paleta de cores neutras padrão %1$s pelas correspondências mais próximas da paleta de cores atual do Site Editor Styles ou do arquivo %2$s em seu tema. As seleções de cores são algorítmicas, e algumas combinações podem não passar nos testes de contraste de acessibilidade. Essa configuração não terá efeito se você estiver usando um tema "clássico" que não inclua um arquivo %3$s.','%1$sThis is currently a beta feature.%2$s It may require making some adjustments to your calendar settings or CSS for optimal display, especially if you have color-coded your feeds. Functionality is subject to change.'=>'%1$sAtualmente, este é um recurso beta%2$s que pode exigir alguns ajustes nas configurações do calendário ou no CSS para otimizar a exibição, especialmente se você tiver codificado os feeds por cores. A funcionalidade está sujeita a alterações.','Dark mode'=>'Modo escuro','Inverts color palette (light colors on a dark background). %1$sNote:%2$s Dark mode also automatically applies style changes similar to the %3$s and %4$s shortcode parameters, so you do not need to include them in your shortcode.'=>'Inverte a paleta de cores (cores claras em um fundo escuro). %1$sObservação:%2$s O modo escuro também aplica automaticamente alterações de estilo semelhantes aos parâmetros de shortcode %3$s e %4$s, portanto, não é necessário incluí-los em seu shortcode.','Loading'=>'Carregando','Always use AJAX to render calendars (recommended)'=>'Sempre use AJAX para renderizar calendários (recomendado)','When checked, all calendars will render via AJAX (asynchronously after the page loads). This is especially useful in conjunction with other caching plugins, or if your calendars contain a large number of events. Normally, calendar data is sent directly in the HTML of the initial page load unless AJAX has been specified in the shortcode.'=>'Quando marcada, todos os calendários serão renderizados via AJAX (de forma assíncrona após o carregamento da página). Isso é especialmente útil em conjunto com outros plug-ins de cache ou se os calendários contiverem um grande número de eventos. Normalmente, os dados do calendário são enviados diretamente no HTML do carregamento inicial da página, a menos que o AJAX tenha sido especificado no shortcode.','Increase memory limit when rendering calendars'=>'Aumentar o limite de memória ao renderizar calendários','If your calendar is failing to load with an "out of memory" fatal error, try increasing the memory limit. A minimum of 512 MB is recommended. %1$s Notes: 1) Some hosting providers may not allow applications to override the server default setting. 2) It is not possible to set this option lower than the current default memory limit on your server.'=>'Se o calendário não estiver sendo carregado com um erro fatal de "falta de memória", tente aumentar o limite de memória. Recomenda-se um mínimo de 512 MB. %1$s Observações: 1) Alguns provedores de hospedagem podem não permitir que os aplicativos substituam a configuração padrão do servidor. 2) Não é possível definir essa opção abaixo do limite de memória padrão atual em seu servidor.','deprecated'=>'obsoleto','If your site has stopped retrieving feeds after the version 11 update, turn on this option to use the legacy request method. This feature is deprecated and will be removed in an update in the near future.'=>'Se o seu site parou de recuperar feeds após a atualização da versão 11, ative essa opção para usar o método de solicitação herdado. Esse recurso está obsoleto e será removido em uma atualização no futuro próximo.','Default shortcode'=>'Código curto padrão','If your site will include a large number of similarly configured calendar shortcodes, you can enter a default "base" shortcode here with the parameters that should be the same for all of the calendars. Individual shortcodes on the site can then include only the parameters that are unique to that calendar, as such: %1$s Any parameters included in the individual shortcode will override what is set here.'=>'Se o seu site incluir um grande número de códigos de acesso de calendário configurados de forma semelhante, você poderá inserir um código de acesso "base" padrão aqui com os parâmetros que devem ser os mesmos para todos os calendários. Os códigos de acesso individuais no site podem, então, incluir somente os parâmetros exclusivos desse calendário, da seguinte forma: %1$s Qualquer parâmetro incluído no shortcode individual substituirá o que for definido aqui.','Allow access to these hostnames that resolve to reserved IP addresses'=>'Permitir o acesso a esses nomes de host que resolvem para endereços IP reservados','If your calendar server is hosted on the same physical server as your website, is part of the same local network, or otherwise uses a %1$sreserved IP address%2$s, enter its hostname here to allow access. For multiple calendar servers, enter one hostname per line. See %3$sthe %4$s documentation%5$s for more information.'=>'Se o servidor de calendário estiver hospedado no mesmo servidor físico que o site, fizer parte da mesma rede local ou usar um endereço IP %1$s reservado%2$s, digite o nome do host aqui para permitir o acesso. Para vários servidores de calendário, digite um nome de host por linha. Consulte %3$sa %4$s documentação%5$s para obter mais informações.','Enter one hostname per line. Hostnames are the base domain name, not a full URL. %1$s For example, you would enter %2$s, not %3$s.'=>'Digite um nome de host por linha. Os nomes de host são o nome de domínio básico, não um URL completo. %1$s Por exemplo, você digitaria %2$s, não %3$s.','Caching'=>'Cache','Transient (cache) expiration'=>'Validade transitória (cache)','seconds'=>'segundos','Sets how long calendar feed data should be cached on the server (WordPress transients) before reloading. Default is 3600 (1 hour).'=>'Define quanto tempo os dados de alimentação do calendário devem ser armazenados em cache no servidor (transientes do WordPress) antes de serem recarregados. O padrão é 3600 (1 hora).','Miscellaneous'=>'Diversos','Remove "Add ICS Calendar" button in Classic Editor'=>'Remover o botão "Adicionar calendário ICS" no Editor Clássico','By default, ICS Calendar adds an "Add ICS Calendar" button to the toolbar above the WYSIWYG editor when using Classic Editor. Check this box to remove the button. Has no effect on sites using the Block Editor (Gutenberg).'=>'Por padrão, o ICS Calendar adiciona um botão "Add ICS Calendar" à barra de ferramentas acima do editor WYSIWYG ao usar o Classic Editor. Marque essa caixa para remover o botão. Não tem efeito em sites que usam o Block Editor (Gutenberg).','%1$s version 10.6 introduced new default values for several shortcode parameters. New installations automatically use the new default values, but upgraded installations will continue to use the old default values, unless this box is checked. Read more about these changes on %2$sour blog%3$s.'=>'%1$s versão 10.6 introduziu novos valores padrão para vários parâmetros de código de atalho. Novas instalações usam automaticamente os novos valores padrão, mas instalações atualizadas continuarão a usar os valores padrão antigos, a menos que esta caixa seja marcada. Leia mais sobre estas mudanças em %2$snosso blog%3$s.','Our complete user guide is available with full translation into dozens of languages on our website:'=>'Nosso guia do usuário completo está disponível com tradução completa em dezenas de idiomas em nosso website:','For assistance, please use our %1$ssupport request form%2$s.'=>'Para obter assistência, use nosso %1$sformulário de solicitação de suporte%2$s.','When contacting support, please include the %1$sSystem Report%2$s from this page.'=>'Ao entrar em contato com o suporte, inclua o %1$sRelatório do sistema%2$s desta página.','Spread the word!'=>'Espalhe a palavra!','If you find %1$s useful, you can help support our continued growth and development with a %2$sfive-star review%3$s. Thank you!'=>'Se você achou %1$s útil, pode ajudar a apoiar nosso crescimento e desenvolvimento contínuos com uma avaliação %2$scinco estrelas%3$s. Muito obrigado!','%1$s Data Cache'=>'%1$s Cache de dados','Clear Cached Calendar Data'=>'Dados claros do calendário em cache','This will immediately clear all existing cached calendar data (purge transients), forcing WordPress to reload all calendars the next time they are viewed. Caching will then resume as before.'=>'Isso limpará imediatamente todos os dados de calendário existentes em cache (expurgo de transitórios), forçando o WordPress a recarregar todos os calendários na próxima vez que eles forem visualizados. Caching então retomará como antes.','ICS Feed URL Tester'=>'Testador de URL de alimentação ics','If you are concerned that the plugin is not properly retrieving your feed, you can test the URL here.'=>'Se estiver preocupado com o fato de o plug-in não estar recuperando corretamente o seu feed, você pode testar o URL aqui.','Enter feed URL...'=>'Digite URL de alimentação...','Test URL'=>'Testar URL','Results:'=>'Resultados:','%1$s received.'=>'%1$s recebido.','This appears to be a valid ICS feed URL.'=>'Esse parece ser um URL válido de feed do ICS.','This does not appear to be a valid ICS feed URL.'=>'Esta não parece ser uma URL de alimentação ICS válida.','Could not retrieve data from the requested URL.'=>'Não foi possível recuperar dados da URL solicitada.','An unknown error occurred while attempting to retrieve the requested URL.'=>'Um erro desconhecido ocorreu ao tentar recuperar a URL solicitada.','Please copy the following text and include it in your message when emailing support.'=>'Copie o texto a seguir e inclua-o em sua mensagem ao enviar suporte por e-mail.','Also please include the %1$s shortcode exactly as you have it entered on the affected page.'=>'Por favor, inclua também o %1$s atalho exatamente como você o inseriu na página afetada.','For your site security please do NOT post the System Report in the support forums.'=>'Para a segurança de seu site, NÃO publique o Relatório do sistema nos fóruns de suporte.','No events found.'=>'Nenhum evento encontrado.','Previous Page'=>'Página anterior','Next Page'=>'Próxima página','All Day'=>'Todos os Dias','Today'=>'Hoje','No events.'=>'Sem eventos.','No additional events this month.'=>'Sem eventos adicionais este mês.','Last week'=>'Semana passada','This week'=>'Esta semana','Next week'=>'Próxima semana','ICS Calendar'=>'ICS Calendar','https://icscalendar.com'=>'https://icscalendar.com','Turn your Google Calendar, Microsoft Office 365 or Apple iCloud Calendar into a seamlessly integrated, auto-updating, zero-maintenance WordPress experience.'=>'Transforme seu Calendário Google, Microsoft Office 365 ou Apple iCloud Calendar em uma experiência WordPress perfeitamente integrada, de atualização automática e com manutenção zero.','Room 34 Creative Services, LLC'=>'Room 34 Creative Services, LLC']];
